import React from 'react';
import images from '../assets/index.js';

function Mug({character}){
    const image = emotes.character;
    console.log(images[0]);
    console.log("Hi.");
    return(
        <img className={"studentMug " + character + " " + image} src={image} alt=""></img>
    )
} export default Mug;
